package com.nullspace.utils;public class NSThreePair<T1, T2, T3>{	private T1 mFirst;	private T2 mSecond;	private T3 mThree;		public NSThreePair(T1 first, T2 second, T3 three)	{		first(first);		second(second);		three(three);	}	public T1 first()	{		return mFirst;	}	public void first(T1 first)	{		this.mFirst = first;	}	public T2 second()	{		return mSecond;	}	public void second(T2 second)	{		this.mSecond = second;	}		public T3 three()	{		return mThree;	}	public void three(T3 three)	{		this.mThree = three;	}}